function add(a,b){

    let sum=a+b;
    return sum;


}
function sub(x,y){

    let min=x-y;

    return min;
}
function mul(a,b){

let mult=a*b;

return mult;
}

function div(a,b){

    let dive =a / b;

    return dive;
}


export default add;

export {sub,mul,div};
